import React from "react";

import "../../index.css";
import LandingPageNavbar from "./sections/LandingPageNavbar";

import Me from "../../assets/me.jpeg";
import { Col, Row, Card, Button } from "react-bootstrap";
import { Link } from "react-router-dom";

const LandingPage = () => {
  return (
    <div className="landingPage">
      <LandingPageNavbar />
      <header className="text-white text-center">
        <div className="container d-flex align-items-center justify-content-around flex-row landingDiv">
          <img
            style={{
              borderTopLeftRadius: "50px",
              borderBottomLeftRadius: "50px"
            }}
            className="mb-5 mt-5 shadow img-fluid me"
            src={Me}
            alt="hello"
          />
          <div>
            <h2 className="text-uppercase mb-0 landingH2">
              <b>hi, i am amirreza ghanei</b> <br /> i am a frontend developer
            </h2>
            <Link to="/dashboard/about">
            <Button variant="outline-info" className="mt-4">
              Learn more about me
            </Button>
            </Link>
          </div>
        </div>
      </header>
    </div>
  );
};

export default LandingPage;
